contracts/SEVEDAO.sol.content:
// SPDX-License-Identifier: Symbeon-Vault
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./SEVEToken.sol";

/**
 * @title SEVE DAO
 * @dev Decentralized Autonomous Organization for SEVE Framework governance
 * @author EON Team - Symbeon Tech
 */
contract SEVEDAO is Ownable, ReentrancyGuard, Pausable {
    // Proposal structure
    struct Proposal {
        uint256 id;
        address proposer;
        string title;
        string description;
        uint256 votesFor;
        uint256 votesAgainst;
        uint256 startTime;
        uint256 endTime;
        bool executed;
        ProposalType proposalType;
        bytes data; // Encoded function call data
    }
    
    // Proposal types
    enum ProposalType {
        TECHNICAL,      // Technical changes to protocol
        FINANCIAL,      // Financial decisions
        PARTNERSHIP,    // Partnership proposals
        GOVERNANCE      // Governance changes
    }
    
    // Vote structure
    struct Vote {
        bool hasVoted;
        bool support;
        uint256 votingPower;
    }
    
    // State variables
    SEVEToken public seveToken;
    
    mapping(uint256 => Proposal) public proposals;
    mapping(uint256 => mapping(address => Vote)) public votes;
    mapping(address => bool) public authorizedProposers;
    
    uint256 public proposalCount;
    uint256 public votingPeriod = 7 days;
    uint256 public executionDelay = 1 days;
    uint256 public quorumThreshold = 10; // 10% of total supply
    uint256 public supermajorityThreshold = 66; // 66% for major changes
    
    // Events
    event ProposalCreated(
        uint256 indexed proposalId,
        address indexed proposer,
        string title,
        ProposalType proposalType
    );
    event VoteCast(
        uint256 indexed proposalId,
        address indexed voter,
        bool support,
        uint256 votingPower
    );
    event ProposalExecuted(uint256 indexed proposalId);
    event ProposalTypeUpdated(uint256 indexed proposalId, ProposalType newType);
    
    constructor(address _seveToken) {
        seveToken = SEVEToken(_seveToken);
        authorizedProposers[msg.sender] = true;
    }
    
    /**
     * @dev Create a new proposal
     * @param title Proposal title
     * @param description Proposal description
     * @param proposalType Type of proposal
     * @param data Encoded function call data (if applicable)
     */
    function createProposal(
        string memory title,
        string memory description,
        ProposalType proposalType,
        bytes memory data
    ) external whenNotPaused returns (uint256) {
        require(authorizedProposers[msg.sender], "Not authorized to propose");
        require(bytes(title).length > 0, "Title cannot be empty");
        require(bytes(description).length > 0, "Description cannot be empty");
        
        uint256 proposalId = proposalCount++;
        
        proposals[proposalId] = Proposal({
            id: proposalId,
            proposer: msg.sender,
            title: title,
            description: description,
            votesFor: 0,
            votesAgainst: 0,
            startTime: block.timestamp,
            endTime: block.timestamp + votingPeriod,
            executed: false,
            proposalType: proposalType,
            data: data
        });
        
        emit ProposalCreated(proposalId, msg.sender, title, proposalType);
        
        return proposalId;
    }
    
    /**
     * @dev Vote on a proposal
     * @param proposalId Proposal ID
     * @param support True for yes, false for no
     */
    function vote(uint256 proposalId, bool support) external nonReentrant {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.id == proposalId, "Proposal does not exist");
        require(block.timestamp >= proposal.startTime, "Voting not started");
        require(block.timestamp <= proposal.endTime, "Voting ended");
        require(!proposal.executed, "Proposal already executed");
        require(!votes[proposalId][msg.sender].hasVoted, "Already voted");
        
        uint256 votingPower = seveToken.getVotingPower(msg.sender);
        require(votingPower > 0, "No voting power");
        
        votes[proposalId][msg.sender] = Vote({
            hasVoted: true,
            support: support,
            votingPower: votingPower
        });
        
        if (support) {
            proposal.votesFor += votingPower;
        } else {
            proposal.votesAgainst += votingPower;
        }
        
        emit VoteCast(proposalId, msg.sender, support, votingPower);
    }
    
    /**
     * @dev Execute a proposal
     * @param proposalId Proposal ID
     */
    function executeProposal(uint256 proposalId) external nonReentrant {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.id == proposalId, "Proposal does not exist");
        require(block.timestamp > proposal.endTime, "Voting not ended");
        require(!proposal.executed, "Proposal already executed");
        require(block.timestamp >= proposal.endTime + executionDelay, "Execution delay not met");
        
        uint256 totalVotes = proposal.votesFor + proposal.votesAgainst;
        uint256 totalSupply = seveToken.totalSupply();
        uint256 quorum = (totalSupply * quorumThreshold) / 100;
        
        require(totalVotes >= quorum, "Quorum not reached");
        
        bool passed = false;
        
        // Check if proposal passed based on type
        if (proposal.proposalType == ProposalType.GOVERNANCE) {
            // Supermajority required for governance changes
            passed = (proposal.votesFor * 100) / totalVotes >= supermajorityThreshold;
        } else {
            // Simple majority for other proposals
            passed = proposal.votesFor > proposal.votesAgainst;
        }
        
        require(passed, "Proposal not passed");
        
        proposal.executed = true;
        
        // Execute proposal based on type
        if (proposal.proposalType == ProposalType.TECHNICAL) {
            _executeTechnicalProposal(proposalId);
        } else if (proposal.proposalType == ProposalType.FINANCIAL) {
            _executeFinancialProposal(proposalId);
        } else if (proposal.proposalType == ProposalType.PARTNERSHIP) {
            _executePartnershipProposal(proposalId);
        } else if (proposal.proposalType == ProposalType.GOVERNANCE) {
            _executeGovernanceProposal(proposalId);
        }
        
        emit ProposalExecuted(proposalId);
    }
    
    /**
     * @dev Execute technical proposal
     * @param proposalId Proposal ID
     */
    function _executeTechnicalProposal(uint256 proposalId) internal {
        // Implementation for technical changes
        // This would typically involve calling functions on the SEVE Protocol contract
        Proposal storage proposal = proposals[proposalId];
        
        // Example: Update protocol parameters
        // This is a placeholder - actual implementation would depend on specific technical changes
        emit ProposalExecuted(proposalId);
    }
    
    /**
     * @dev Execute financial proposal
     * @param proposalId Proposal ID
     */
    function _executeFinancialProposal(uint256 proposalId) internal {
        // Implementation for financial decisions
        // This would typically involve treasury management
        Proposal storage proposal = proposals[proposalId];
        
        // Example: Allocate funds for development
        // This is a placeholder - actual implementation would depend on specific financial decisions
        emit ProposalExecuted(proposalId);
    }
    
    /**
     * @dev Execute partnership proposal
     * @param proposalId Proposal ID
     */
    function _executePartnershipProposal(uint256 proposalId) internal {
        // Implementation for partnership decisions
        // This would typically involve authorizing new partners
        Proposal storage proposal = proposals[proposalId];
        
        // Example: Authorize new licensor
        // This is a placeholder - actual implementation would depend on specific partnerships
        emit ProposalExecuted(proposalId);
    }
    
    /**
     * @dev Execute governance proposal
     * @param proposalId Proposal ID
     */
    function _executeGovernanceProposal(uint256 proposalId) internal {
        // Implementation for governance changes
        // This would typically involve updating DAO parameters
        Proposal storage proposal = proposals[proposalId];
        
        // Example: Update voting parameters
        // This is a placeholder - actual implementation would depend on specific governance changes
        emit ProposalExecuted(proposalId);
    }
    
    /**
     * @dev Get proposal details
     * @param proposalId Proposal ID
     * @return proposal Proposal details
     */
    function getProposal(uint256 proposalId) external view returns (Proposal memory) {
        return proposals[proposalId];
    }
    
    /**
     * @dev Get user's vote on a proposal
     * @param proposalId Proposal ID
     * @param voter Voter address
     * @return vote Vote details
     */
    function getUserVote(uint256 proposalId, address voter) external view returns (Vote memory) {
        return votes[proposalId][voter];
    }
    
    /**
     * @dev Get proposal status
     * @param proposalId Proposal ID
     * @return status Proposal status string
     */
    function getProposalStatus(uint256 proposalId) external view returns (string memory) {
        Proposal memory proposal = proposals[proposalId];
        
        if (proposal.id != proposalId) {
            return "Non-existent";
        }
        
        if (proposal.executed) {
            return "Executed";
        }
        
        if (block.timestamp < proposal.startTime) {
            return "Pending";
        }
        
        if (block.timestamp <= proposal.endTime) {
            return "Active";
        }
        
        if (block.timestamp < proposal.endTime + executionDelay) {
            return "Execution Delay";
        }
        
        uint256 totalVotes = proposal.votesFor + proposal.votesAgainst;
        uint256 totalSupply = seveToken.totalSupply();
        uint256 quorum = (totalSupply * quorumThreshold) / 100;
        
        if (totalVotes < quorum) {
            return "Failed - No Quorum";
        }
        
        bool passed = false;
        if (proposal.proposalType == ProposalType.GOVERNANCE) {
            passed = (proposal.votesFor * 100) / totalVotes >= supermajorityThreshold;
        } else {
            passed = proposal.votesFor > proposal.votesAgainst;
        }
        
        return passed ? "Passed" : "Failed";
    }
    
    /**
     * @dev Set voting period
     * @param newVotingPeriod New voting period in seconds
     */
    function setVotingPeriod(uint256 newVotingPeriod) external onlyOwner {
        require(newVotingPeriod >= 1 days, "Voting period too short");
        require(newVotingPeriod <= 30 days, "Voting period too long");
        
        votingPeriod = newVotingPeriod;
    }
    
    /**
     * @dev Set execution delay
     * @param newExecutionDelay New execution delay in seconds
     */
    function setExecutionDelay(uint256 newExecutionDelay) external onlyOwner {
        require(newExecutionDelay <= 7 days, "Execution delay too long");
        
        executionDelay = newExecutionDelay;
    }
    
    /**
     * @dev Set quorum threshold
     * @param newQuorumThreshold New quorum threshold in percentage
     */
    function setQuorumThreshold(uint256 newQuorumThreshold) external onlyOwner {
        require(newQuorumThreshold >= 5, "Quorum threshold too low");
        require(newQuorumThreshold <= 50, "Quorum threshold too high");
        
        quorumThreshold = newQuorumThreshold;
    }
    
    /**
     * @dev Set supermajority threshold
     * @param newSupermajorityThreshold New supermajority threshold in percentage
     */
    function setSupermajorityThreshold(uint256 newSupermajorityThreshold) external onlyOwner {
        require(newSupermajorityThreshold >= 51, "Supermajority threshold too low");
        require(newSupermajorityThreshold <= 90, "Supermajority threshold too high");
        
        supermajorityThreshold = newSupermajorityThreshold;
    }
    
    /**
     * @dev Authorize a proposer
     * @param proposer Proposer address
     * @param authorized Authorization status
     */
    function setAuthorizedProposer(address proposer, bool authorized) external onlyOwner {
        authorizedProposers[proposer] = authorized;
    }
    
    /**
     * @dev Pause DAO in case of emergency
     */
    function pause() external onlyOwner {
        _pause();
    }
    
    /**
     * @dev Unpause DAO
     */
    function unpause() external onlyOwner {
        _unpause();
    }
}

contracts/SEVEProtocol.sol.content:
// SPDX-License-Identifier: Symbeon-Vault
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./SEVEToken.sol";

/**
 * @title SEVE Protocol
 * @dev Main protocol contract for SEVE Framework licensing and agent management
 * @author EON Team - Symbeon Tech
 */
contract SEVEProtocol is Ownable, ReentrancyGuard, Pausable {
    // License structure
    struct License {
        address licensee;
        string version;
        uint256 duration;
        uint256 price;
        bool active;
        uint256 timestamp;
        bytes32 codeHash;
        string capabilities;
    }
    
    // Agent structure
    struct Agent {
        address agentAddress;
        string capabilities;
        uint256 performanceScore;
        bool verified;
        uint256 registrationTime;
        bytes32 agentHash;
        string metadata;
    }
    
    // Version pricing structure
    struct VersionInfo {
        uint256 price;
        bool available;
        string description;
        bytes32 codeHash;
        uint256 timestamp;
    }
    
    // State variables
    mapping(address => License[]) public licenses;
    mapping(address => Agent) public agents;
    mapping(string => VersionInfo) public versionPricing;
    mapping(address => bool) public authorizedLicensors;
    mapping(bytes32 => bool) public registeredCodeHashes;
    
    SEVEToken public seveToken;
    
    uint256 public totalLicensesSold;
    uint256 public totalRevenue;
    uint256 public protocolFeeRate = 100; // 1% (100 basis points)
    
    // Events
    event LicensePurchased(
        address indexed buyer, 
        string version, 
        uint256 price, 
        uint256 duration,
        bytes32 codeHash
    );
    event AgentRegistered(
        address indexed agent, 
        string capabilities, 
        bytes32 agentHash
    );
    event PerformanceUpdated(
        address indexed agent, 
        uint256 score
    );
    event AgentVerified(address indexed agent, bool verified);
    event VersionAdded(string version, uint256 price, bytes32 codeHash);
    event ProtocolFeeUpdated(uint256 newFeeRate);
    
    constructor(address _seveToken) {
        seveToken = SEVEToken(_seveToken);
        authorizedLicensors[msg.sender] = true;
    }
    
    /**
     * @dev Purchase a license for SEVE Framework
     * @param version Version of the framework
     * @param duration Duration of the license in days
     * @param capabilities Required capabilities
     */
    function purchaseLicense(
        string memory version,
        uint256 duration,
        string memory capabilities
    ) external nonReentrant whenNotPaused {
        require(versionPricing[version].available, "Version not available");
        require(duration > 0, "Duration must be greater than 0");
        
        uint256 price = versionPricing[version].price * duration / 365; // Pro-rated pricing
        require(seveToken.balanceOf(msg.sender) >= price, "Insufficient SEVE tokens");
        
        // Transfer tokens
        seveToken.transferFrom(msg.sender, address(this), price);
        
        // Calculate protocol fee
        uint256 protocolFee = (price * protocolFeeRate) / 10000;
        uint256 licensorRevenue = price - protocolFee;
        
        // Create license
        License memory newLicense = License({
            licensee: msg.sender,
            version: version,
            duration: duration,
            price: price,
            active: true,
            timestamp: block.timestamp,
            codeHash: versionPricing[version].codeHash,
            capabilities: capabilities
        });
        
        licenses[msg.sender].push(newLicense);
        totalLicensesSold++;
        totalRevenue += price;
        
        emit LicensePurchased(
            msg.sender, 
            version, 
            price, 
            duration,
            versionPricing[version].codeHash
        );
    }
    
    /**
     * @dev Register an AI agent
     * @param capabilities Agent capabilities
     * @param agentHash Hash of agent code
     * @param metadata Agent metadata
     */
    function registerAgent(
        string memory capabilities,
        bytes32 agentHash,
        string memory metadata
    ) external nonReentrant whenNotPaused {
        require(!agents[msg.sender].verified, "Agent already registered");
        require(agentHash != bytes32(0), "Invalid agent hash");
        require(!registeredCodeHashes[agentHash], "Agent hash already registered");
        
        Agent memory newAgent = Agent({
            agentAddress: msg.sender,
            capabilities: capabilities,
            performanceScore: 0,
            verified: false,
            registrationTime: block.timestamp,
            agentHash: agentHash,
            metadata: metadata
        });
        
        agents[msg.sender] = newAgent;
        registeredCodeHashes[agentHash] = true;
        
        emit AgentRegistered(msg.sender, capabilities, agentHash);
    }
    
    /**
     * @dev Update agent performance score
     * @param agent Agent address
     * @param score New performance score
     */
    function updatePerformance(
        address agent,
        uint256 score
    ) external onlyOwner {
        require(agents[agent].verified, "Agent not verified");
        require(score <= 100, "Score must be between 0 and 100");
        
        agents[agent].performanceScore = score;
        
        emit PerformanceUpdated(agent, score);
    }
    
    /**
     * @dev Verify an agent
     * @param agent Agent address
     * @param verified Verification status
     */
    function verifyAgent(
        address agent,
        bool verified
    ) external onlyOwner {
        require(agents[agent].agentAddress != address(0), "Agent not registered");
        
        agents[agent].verified = verified;
        
        emit AgentVerified(agent, verified);
    }
    
    /**
     * @dev Add a new version of SEVE Framework
     * @param version Version string
     * @param price Annual price in SEVE tokens
     * @param codeHash Hash of the code
     * @param description Version description
     */
    function addVersion(
        string memory version,
        uint256 price,
        bytes32 codeHash,
        string memory description
    ) external onlyOwner {
        require(price > 0, "Price must be greater than 0");
        require(codeHash != bytes32(0), "Invalid code hash");
        require(!registeredCodeHashes[codeHash], "Code hash already registered");
        
        versionPricing[version] = VersionInfo({
            price: price,
            available: true,
            description: description,
            codeHash: codeHash,
            timestamp: block.timestamp
        });
        
        registeredCodeHashes[codeHash] = true;
        
        emit VersionAdded(version, price, codeHash);
    }
    
    /**
     * @dev Set protocol fee rate
     * @param newFeeRate New fee rate in basis points (100 = 1%)
     */
    function setProtocolFeeRate(uint256 newFeeRate) external onlyOwner {
        require(newFeeRate <= 1000, "Fee rate too high"); // Max 10%
        
        protocolFeeRate = newFeeRate;
        
        emit ProtocolFeeUpdated(newFeeRate);
    }
    
    /**
     * @dev Authorize a licensor
     * @param licensor Licensor address
     * @param authorized Authorization status
     */
    function setAuthorizedLicensor(
        address licensor,
        bool authorized
    ) external onlyOwner {
        authorizedLicensors[licensor] = authorized;
    }
    
    /**
     * @dev Get user's active licenses
     * @param user User address
     * @return activeLicenses Array of active licenses
     */
    function getActiveLicenses(address user) external view returns (License[] memory) {
        License[] memory userLicenses = licenses[user];
        License[] memory activeLicenses = new License[](userLicenses.length);
        uint256 activeCount = 0;
        
        for (uint256 i = 0; i < userLicenses.length; i++) {
            if (userLicenses[i].active && 
                block.timestamp < userLicenses[i].timestamp + (userLicenses[i].duration * 1 days)) {
                activeLicenses[activeCount] = userLicenses[i];
                activeCount++;
            }
        }
        
        // Resize array to actual active count
        License[] memory result = new License[](activeCount);
        for (uint256 i = 0; i < activeCount; i++) {
            result[i] = activeLicenses[i];
        }
        
        return result;
    }
    
    /**
     * @dev Check if user has valid license for version
     * @param user User address
     * @param version Version to check
     * @return hasLicense True if user has valid license
     */
    function hasValidLicense(address user, string memory version) external view returns (bool) {
        License[] memory userLicenses = licenses[user];
        
        for (uint256 i = 0; i < userLicenses.length; i++) {
            if (userLicenses[i].active && 
                keccak256(bytes(userLicenses[i].version)) == keccak256(bytes(version)) &&
                block.timestamp < userLicenses[i].timestamp + (userLicenses[i].duration * 1 days)) {
                return true;
            }
        }
        
        return false;
    }
    
    /**
     * @dev Get agent information
     * @param agent Agent address
     * @return agentInfo Agent information
     */
    function getAgentInfo(address agent) external view returns (Agent memory) {
        return agents[agent];
    }
    
    /**
     * @dev Get version information
     * @param version Version string
     * @return versionInfo Version information
     */
    function getVersionInfo(string memory version) external view returns (VersionInfo memory) {
        return versionPricing[version];
    }
    
    /**
     * @dev Withdraw protocol fees
     */
    function withdrawFees() external onlyOwner {
        uint256 balance = seveToken.balanceOf(address(this));
        require(balance > 0, "No fees to withdraw");
        
        seveToken.transfer(owner(), balance);
    }
    
    /**
     * @dev Pause protocol in case of emergency
     */
    function pause() external onlyOwner {
        _pause();
    }
    
    /**
     * @dev Unpause protocol
     */
    function unpause() external onlyOwner {
        _unpause();
    }
}

contracts/SEVEToken.sol.content:
// SPDX-License-Identifier: Symbeon-Vault
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

/**
 * @title SEVE Token
 * @dev ERC-20 token for SEVE Framework Protocol
 * @author EON Team - Symbeon Tech
 */
contract SEVEToken is ERC20, Ownable, ReentrancyGuard, Pausable {
    // Token parameters
    uint256 public constant TOTAL_SUPPLY = 1_000_000_000 * 10**18; // 1 billion tokens
    uint256 public constant MAX_SUPPLY = 1_000_000_000 * 10**18;
    
    // Distribution parameters
    uint256 public constant TEAM_ALLOCATION = 200_000_000 * 10**18; // 20%
    uint256 public constant DEVELOPMENT_ALLOCATION = 300_000_000 * 10**18; // 30%
    uint256 public constant COMMUNITY_ALLOCATION = 250_000_000 * 10**18; // 25%
    uint256 public constant PARTNERSHIP_ALLOCATION = 150_000_000 * 10**18; // 15%
    uint256 public constant RESERVE_ALLOCATION = 100_000_000 * 10**18; // 10%
    
    // Vesting parameters
    uint256 public constant VESTING_DURATION = 365 days; // 1 year
    uint256 public constant CLIFF_DURATION = 90 days; // 3 months
    
    // Staking parameters
    uint256 public constant STAKING_REWARD_RATE = 10; // 10% APY
    uint256 public constant GOVERNANCE_STAKING_RATE = 8; // 8% APY
    
    // State variables
    mapping(address => uint256) public stakedAmount;
    mapping(address => uint256) public stakingStartTime;
    mapping(address => bool) public isStaking;
    
    mapping(address => uint256) public governanceStakedAmount;
    mapping(address => uint256) public governanceStakingStartTime;
    mapping(address => bool) public isGovernanceStaking;
    
    uint256 public totalStaked;
    uint256 public totalGovernanceStaked;
    
    // Events
    event TokensStaked(address indexed user, uint256 amount, uint256 timestamp);
    event TokensUnstaked(address indexed user, uint256 amount, uint256 reward);
    event GovernanceStaked(address indexed user, uint256 amount);
    event GovernanceUnstaked(address indexed user, uint256 amount, uint256 reward);
    
    constructor() ERC20("SEVE Token", "SEVE") {
        // Initial distribution
        _mint(msg.sender, TEAM_ALLOCATION);
        _mint(msg.sender, DEVELOPMENT_ALLOCATION);
        _mint(msg.sender, COMMUNITY_ALLOCATION);
        _mint(msg.sender, PARTNERSHIP_ALLOCATION);
        _mint(msg.sender, RESERVE_ALLOCATION);
    }
    
    /**
     * @dev Stake tokens for rewards
     * @param amount Amount of tokens to stake
     */
    function stake(uint256 amount) external nonReentrant whenNotPaused {
        require(amount > 0, "Amount must be greater than 0");
        require(balanceOf(msg.sender) >= amount, "Insufficient balance");
        
        if (isStaking[msg.sender]) {
            // Claim existing rewards before restaking
            claimStakingRewards();
        }
        
        _transfer(msg.sender, address(this), amount);
        stakedAmount[msg.sender] += amount;
        stakingStartTime[msg.sender] = block.timestamp;
        isStaking[msg.sender] = true;
        totalStaked += amount;
        
        emit TokensStaked(msg.sender, amount, block.timestamp);
    }
    
    /**
     * @dev Unstake tokens and claim rewards
     * @param amount Amount of tokens to unstake
     */
    function unstake(uint256 amount) external nonReentrant {
        require(amount > 0, "Amount must be greater than 0");
        require(isStaking[msg.sender], "Not staking");
        require(stakedAmount[msg.sender] >= amount, "Insufficient staked amount");
        
        uint256 reward = calculateStakingRewards(msg.sender);
        
        stakedAmount[msg.sender] -= amount;
        totalStaked -= amount;
        
        if (stakedAmount[msg.sender] == 0) {
            isStaking[msg.sender] = false;
        }
        
        _transfer(address(this), msg.sender, amount + reward);
        
        emit TokensUnstaked(msg.sender, amount, reward);
    }
    
    /**
     * @dev Claim staking rewards without unstaking
     */
    function claimStakingRewards() public nonReentrant {
        require(isStaking[msg.sender], "Not staking");
        
        uint256 reward = calculateStakingRewards(msg.sender);
        require(reward > 0, "No rewards to claim");
        
        stakingStartTime[msg.sender] = block.timestamp;
        _mint(msg.sender, reward);
        
        emit TokensUnstaked(msg.sender, 0, reward);
    }
    
    /**
     * @dev Calculate staking rewards for a user
     * @param user User address
     * @return reward Calculated reward amount
     */
    function calculateStakingRewards(address user) public view returns (uint256) {
        if (!isStaking[user]) return 0;
        
        uint256 stakingDuration = block.timestamp - stakingStartTime[user];
        uint256 annualReward = (stakedAmount[user] * STAKING_REWARD_RATE) / 100;
        uint256 reward = (annualReward * stakingDuration) / 365 days;
        
        return reward;
    }
    
    /**
     * @dev Stake tokens for governance participation
     * @param amount Amount of tokens to stake for governance
     */
    function stakeForGovernance(uint256 amount) external nonReentrant whenNotPaused {
        require(amount > 0, "Amount must be greater than 0");
        require(balanceOf(msg.sender) >= amount, "Insufficient balance");
        
        if (isGovernanceStaking[msg.sender]) {
            claimGovernanceRewards();
        }
        
        _transfer(msg.sender, address(this), amount);
        governanceStakedAmount[msg.sender] += amount;
        governanceStakingStartTime[msg.sender] = block.timestamp;
        isGovernanceStaking[msg.sender] = true;
        totalGovernanceStaked += amount;
        
        emit GovernanceStaked(msg.sender, amount);
    }
    
    /**
     * @dev Unstake governance tokens and claim rewards
     * @param amount Amount of tokens to unstake
     */
    function unstakeGovernance(uint256 amount) external nonReentrant {
        require(amount > 0, "Amount must be greater than 0");
        require(isGovernanceStaking[msg.sender], "Not governance staking");
        require(governanceStakedAmount[msg.sender] >= amount, "Insufficient governance staked amount");
        
        uint256 reward = calculateGovernanceRewards(msg.sender);
        
        governanceStakedAmount[msg.sender] -= amount;
        totalGovernanceStaked -= amount;
        
        if (governanceStakedAmount[msg.sender] == 0) {
            isGovernanceStaking[msg.sender] = false;
        }
        
        _transfer(address(this), msg.sender, amount + reward);
        
        emit GovernanceUnstaked(msg.sender, amount, reward);
    }
    
    /**
     * @dev Claim governance staking rewards
     */
    function claimGovernanceRewards() public nonReentrant {
        require(isGovernanceStaking[msg.sender], "Not governance staking");
        
        uint256 reward = calculateGovernanceRewards(msg.sender);
        require(reward > 0, "No rewards to claim");
        
        governanceStakingStartTime[msg.sender] = block.timestamp;
        _mint(msg.sender, reward);
        
        emit GovernanceUnstaked(msg.sender, 0, reward);
    }
    
    /**
     * @dev Calculate governance staking rewards
     * @param user User address
     * @return reward Calculated reward amount
     */
    function calculateGovernanceRewards(address user) public view returns (uint256) {
        if (!isGovernanceStaking[user]) return 0;
        
        uint256 stakingDuration = block.timestamp - governanceStakingStartTime[user];
        uint256 annualReward = (governanceStakedAmount[user] * GOVERNANCE_STAKING_RATE) / 100;
        uint256 reward = (annualReward * stakingDuration) / 365 days;
        
        return reward;
    }
    
    /**
     * @dev Get user's voting power for governance
     * @param user User address
     * @return votingPower User's voting power
     */
    function getVotingPower(address user) external view returns (uint256) {
        uint256 stakingPower = stakedAmount[user];
        uint256 governancePower = governanceStakedAmount[user];
        
        return stakingPower + governancePower;
    }
    
    /**
     * @dev Pause contract in case of emergency
     */
    function pause() external onlyOwner {
        _pause();
    }
    
    /**
     * @dev Unpause contract
     */
    function unpause() external onlyOwner {
        _unpause();
    }
    
    /**
     * @dev Override transfer to allow staking/unstaking
     */
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        super._beforeTokenTransfer(from, to, amount);
        
        require(!paused() || from == owner() || to == owner(), "Transfers paused");
    }
}

